import { NavLink } from "react-router-dom";

export default function ShowButton(props){
    let href = "/menutable/";

    if(props.value !== undefined){
        href += props.value;
    }

    return (
        <>
            <NavLink to={href}  className="btn-close-white" >
                {props.value}
            </NavLink>
        </>
    )
}
